#include <stdio.h>
#include <stdlib.h>
#include <math.h>

int main() {
    int t;
    scanf("%d", &t);
    while (t--) {
        int n;
        scanf("%d", &n);
        int b[1000], a[1000];
        int i, j, k = 0;
        for (i = 0; i <= n * (n + 1) / 2 - 2; i++) {
            scanf("%d", &b[i]);
        }
        for (i = 0; i < n; i++) {
            a[i] = b[i];
        }
        for (i = n; i < n * (n + 1) / 2 - 1; i++) {
            for (j = 0; j < n; j++) {
                if (b[i] % a[j] == 0) {
                    k++;
                    if (k == 1) {
                        a[n] = b[i] / a[j];
                    } else {
                        a[k - 1] = b[i] / a[j];
                    }
                }
            }
        }
        printf("%d\n", a[n]);
        for (i = 0; i < n; i++) {
            printf("%d ", a[i]);
        }
        printf("\n");
    }
    return 0;
}
